import React, {useState} from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  let [글제목, 글제목변경] = useState(['남자 코트 추천', '강남 우동 맛집']);
  let [작성일, 작성일변경] = useState('1월 26일 발행');
  //let posts = '강남 고기 맛집';

  return (
    <div className="App">
      <div className="black-nav">
          <img src={logo} width='100'/>
          <div>개발 Blog</div>
      </div>
      <div className="list">
        <h3> {글제목} </h3>
        <p> {작성일} </p>
        <hr/>
      </div>
    </div>
  );
}

export default App;
